textOriginal:
Sabe a cartinha da Democracia que depois recebe do TSE, a mando do PT, censura prévia? É a mesma coisa. É típico daquelas pessoas que sabem o que fazem, querendo enganar os analfabetos e funcionais. Sinceramente? Temos que:
1. Acabar com o Lula nessas eleições;
2. Buscar a verdade por trás dessas cartinhas. Não é apenas hipocrisia, necessita de investigação jornalística para buscar a verdade, a manipulação das massas e escancarar numa matéria.
